--  DDL for Table ACCESS_TOKEN_USER
--------------------------------------------------------
BEGIN
EXECUTE IMMEDIATE 'CREATE BIGFILE TABLESPACE AUTHDB_DATA DATAFILE ''authdb.dat'' SIZE 10M AUTOEXTEND ON';
EXECUTE IMMEDIATE 'CREATE BIGFILE TABLESPACE ENCRYPTED_HAREPO DATAFILE ''encryptedharepodb.dat'' SIZE 10M AUTOEXTEND ON';

EXCEPTION
    WHEN OTHERS THEN
      IF SQLCODE = -955 THEN
        NULL; -- suppresses ORA-00955 exception (name already being used by an existing object)
      ELSIF SQLCODE = -1543 THEN
        NULL; -- suppresses ORA-01543 exception (tablespace %s already exists)
      ELSE
         RAISE;
      END IF;
END;
/
